import './FaceRecognition.css'

const FaceRecognition = ({ imageUrl, boundingBoxes }) => {
    const boxData = {
        top: `${boundingBox.top_row*100}%`,
        right: `${(1-boundingBox.right_col)*100}%`,
        bottom: `${(1-boundingBox.bottom_row)*100}%`,
        left: `${boundingBox.left_col*100}%`
    };
    const drawBox = {
        inset: `${boxData.top} ${boxData.right} ${boxData.bottom} ${boxData.left}`
    };
    return (
        <div className="relative flex justify-center">
            <div className = "absolute ma3 mw6">
               <img className='' alt='' src='https://images.pexels.com/photos/2379005/pexels-photo-2379005.jpeg' />
               <div className="box" style={drawBox}></div>
            </div>
        </div>
    );
}

export default FaceRecognition;

